def build_overlap_graph(kmers):
    # Determine k based on the length of the first k-mer
    k = len(kmers[0])
    prefix_map = {}
    # Map each k-mer by its prefix of length k-1
    for kmer in kmers:
        prefix = kmer[:k-1]
        prefix_map.setdefault(prefix, []).append(kmer)

    adjacency = {}
    # For each k-mer, find which k-mers can follow it
    for kmer in kmers:
        suffix = kmer[1:]  # Suffix of length k-1
        if suffix in prefix_map:
            # The k-mers in prefix_map[suffix] follow 'kmer'
            adjacency[kmer] = prefix_map[suffix]

    return adjacency

